    true,nt"url": null,nt"notes": "The GPM Ground Validation Oklahoma Climatological
    Survey Mesonet MC3E data were collected during the Midlatitude Continental Convective
    Clouds Experiment (MC3E) in central Oklahoma during the April-June 2011 period.
     Collected by a network of weather stations, this dataset is composed of 15 minute
    and 5 minute files with one file per site per day in mts format.  Data can be read
    as ASCII text.  Multiple parameters found in this dataset include relative humidity,
    air temperature, wind speed and direction, precipitation and calibrated soil moisture.
     More information on the contents and data format can be found at http://www.mesonet.org/index.php/site/about/mdf_mts_files.",nt"license_title":
